import React from 'react';
import {Navbar,Nav, NavDropdown} from 'react-bootstrap';
import {Link} from 'react-router-dom';
import AuthenticationService from '../../../auth/services/AuthenticationService';
import './style/Sidebar.css'
import { Label } from 'reactstrap';
import Logout from '../../../assets/menu/logout.jpg';

class Sidebar extends React.Component{
    handleLogout = () => {
        AuthenticationService.logout().then(() => {
          //una vez eliminado el session storage hacemos un redirect al login
        //   this.props.history.push('/');
          window.location = '/login';
        });
      };
    render(){
        
        return(
            
            <Navbar collapseOnSelect expand="lg" bg="dark" variant="dark" id="navbar-menu">
            <Navbar.Brand href="/">Walle</Navbar.Brand>
            <Navbar.Toggle aria-controls="responsive-navbar-nav" />
            <Navbar.Collapse id="responsive-navbar-nav">
                <Nav className="mr-auto">
                    <NavDropdown title="Partes" id="basic-nav-dropdown">
                        <NavDropdown.Item href="/">Nueva Parte</NavDropdown.Item>
                        <NavDropdown.Item href="#action/3.2">Listar Parte</NavDropdown.Item>                        
                    </NavDropdown>
                    <NavDropdown title="Stock" id="collasible-nav-dropdown">
                        <NavDropdown.Item href="/">Agregar a Stock</NavDropdown.Item>
                        <NavDropdown.Item href="#action/3.2">Listar Stock</NavDropdown.Item>                        
                    </NavDropdown>
                    <NavDropdown title="Remitos" id="collasible-nav-dropdown">
                        <NavDropdown.Item href="/">Nuevo Remito</NavDropdown.Item>
                        <NavDropdown.Item href="#action/3.2">Listar Remito</NavDropdown.Item>                        
                    </NavDropdown>
                    <NavDropdown title="Ordenes de Reparacion" id="collasible-nav-dropdown">
                        <NavDropdown.Item href="/">Nueva Orden de reparacion</NavDropdown.Item>
                        <NavDropdown.Item href="#action/3.2">Listar Ordenes</NavDropdown.Item>                        
                    </NavDropdown>                   
                    {/* <Nav.Link >
                        <Link className='navbar-brand' to="/cart">
                            Orden de Reparacion
                        </Link>
                    </Nav.Link> */}
                    <NavDropdown title="Remitos" id="collasible-nav-dropdown">
                        <NavDropdown.Item href="/users">Agregar Remitos</NavDropdown.Item>
                        <NavDropdown.Item href="#action/3.2">Listar Remitos</NavDropdown.Item>                        
                    </NavDropdown>
                    </Nav>
                    <Nav>
                    <Label className='navbar-nav-name' >Jose Montivero</Label>
                    <Nav.Link eventKey={2} href="#memes" onClick={this.handleLogout}>
                        <img title ='Cerrar Sesion' src={Logout}>
                        </img>                        
                    </Nav.Link>
                </Nav>
            </Navbar.Collapse>
            </Navbar>
        )
    }
}

export default Sidebar;
